import React, { Component } from "react";
import { Link } from "react-router-dom";
import style from "./index.module.scss";

export default class Nav extends Component {
  render() {
    return (
      <div className={style.container}>
        <ul>
          <li>Fares</li>
          <li>Trip Planner</li>
          <li>About</li>
          <li>Sign In</li>
        </ul>
      </div>
    );
  }
}
